    "Integrated Visualization Environment for Science Mission Modeling Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:50:11.853757",nt"name": "integrated-visualization-environment-for-science-mission-modeling-project-fa6ee",nt"isopen":
    true,nt"url": null,nt"notes": "NASA is emphasizing the use of larger, more
    integrated models in conjunction with systems engineering tools and decision support
    systems. These tools place a corresponding stress on legacy engineering visualization
    systems which now are required to handle larger data sets, provide more intuition
    to the user, integrate well with many other tools, and help the user with his/her
    ultimate goal: improving the design of complex systems.    rnPhoenix Integration
    proposes to complete the prototype visualization environment created during Phase
    I to the point where it is a commercially viable product. New features, refinements,
    and integration with other tools will be accomplished in Phase II. In particular,
    the work will involve major improvements to whitespace exploration algorithms, techniques
    that enable users to unconstrain or modify the underlying engineering model in an
    effort to obtain results in previously unattainable areas. Work will also include
    more data mining algorithms (e.g. Principal Component Analysis), new graph types
    (e.g. spider plots), export formats to 3-D tools (e.g. Tecplot), integration with
    MBSE/SysML tools, integration with web-based decision support environments, and
    incorporation of probabilistic analysis. A rich integration with ModelCenter, the
    company's engineering integration and trade study environment, is planned, although
    a standalone capability will also be offered. The visualizer's architecture will
    be based on OpenGL and will use the GPU to parallelize rendering computations. Design
    will focus on usability and responsiveness, with the goal of providing quick insight
    into complex data. The tool will be user-tested through early adopters to ensure
    relevance and to guide development.",nt"license_title": "U.S. Government Work",nt"extras":
